 // \u591a\u64ad\u7684Observable\n    const observable = from([1, 2, 3])\n    const subject = new Subject()\n    const afterMulticast = observable.pipe(multicast(() => subject))\n    // \u5728\u5e95\u5c42\u4f7f\u7528\u4e86 `subject.subscribe({...})`:\n    afterMulticast.subscribe(val =>\n      setHtml('multicastOutput', `observerA ${val}`),\n    )\n    afterMulticast.subscribe(val =>\n      setHtml('multicastOutput', `observerB ${val}`),\n    )\n    // \u5728\u5e95\u5c42\u4f7f\u7528\u4e86 `source.subscribe(subject)`:\n    afterMulticast.connect()\n\n    // \u4f8b1\uff1a \u4f7f\u7528\u6807\u51c6\u7684 Subject \u8fdb\u884c multicast\n    // const observable2 = interval(1000).pipe(\n    //   tap(() => setHtml('multicastOutput', 'Side Effect #1')),\n    //   // mapTo('Result!'),\n    //   take(4),\n    // );\n    // const multi = observable2.pipe(multicast(() => new Subject()));\n    // multi.subscribe(val => setHtml('multicastOutput', `observerA ${val}`));\n    // multi.subscribe(val => setHtml('multicastOutput', `observerB ${val}`));\n    // multi.connect();\n\n    // \u4f8b2\uff1a \u4f7f\u7528 ReplaySubject \u8fdb\u884c\u591a\u64ad\n    // const example2 = interval(1000).pipe(\n    //   tap(() => setHtml('multicastOutput', 'Side Effect #1')),\n    //   take(8),\n    // );\n    // const multi1 = example2.pipe(multicast(() => new ReplaySubject(5)));\n    // multi1.connect();\n    // setTimeout(() => {\n    //   const subscriber = multi.subscribe(val => console.log(val));\n    // }, 5000);\n  }, [])\n\n  return (\n    <>\n      <div>\u8f93\u51fa:</div>\n      <div id=\"multicastOutput\" />\n    </>\n  )\n}\nexport default Index",Z="import React, { useEffect, useState } from 'react'\nimport { Subject, interval, of, timer, ReplaySubject, from } from 'rxjs'\nimport {\n  tap,\n  take,\n  pluck,\n  mapTo,\n  publish,\n  multicast,\n  share,\n  shareReplay,\n} from 'rxjs/operators'\nimport 'rxjs/add/operator/observeOn'\nimport { setHtml } from '../../../../utils/htmlTool'\n\nconst Index: React.FC = () => {\n  useEffect(() => {\n    const source = timer(1000)\n    const example = source.pipe(\n      tap(() => setHtml('shareOutput', '***SIDE EFFECT***')),\n      mapTo('***RESULT***'),\n    )\n    // const subscribeOne = example.subscribe((val) => console.log(val));\n    // const subscribeTwo = example.subscribe((val) => console.log(val));\n\n    const sharedExample = example.pipe(share())\n    const subscribeThree = sharedExample.subscribe(val =>\n      setHtml('shareOutput', val),\n    )\n    const subscribeFour = sharedExample.subscribe(val =>\n      setHtml('shareOutput', val),\n    )\n  }, [])\n\n  return (\n    <>\n      <div>\u8f93\u51fa:</div>\n      <div id=\"shareOutput\" />\n    </>\n  )\n}\nexport default Index",$="import React, { useEffect, useState } from 'react'\nimport { Subject, interval, of, timer, ReplaySubject, from } from 'rxjs'\nimport {\n  tap,\n  take,\n  pluck,\n  mapTo,\n  publish,\n  multicast,\n  share,\n  shareReplay,\n} from 'rxjs/operators'\nimport 'rxjs/add/operator/observeOn'\nimport { setHtml } from '../../../../utils/htmlTool'\n\nconst Index: React.FC = () => {\n  useEffect(() => {\n    const routeEnd = new Subject<{ data: any; url: string }>()\n    const lastUrl = routeEnd.pipe(\n      tap(() => setHtml('shareReplayOutput', 'executed')),\n      pluck('url'),\n      shareReplay(1),\n    )\n    lastUrl.subscribe(val => setHtml('shareReplayOutput', `observerA ${val}`))\n    lastUrl.subscribe(val => setHtml('shareReplayOutput', `observerB ${val}`))\n    routeEnd.next({ data: {}, url: 'my-path' })\n    routeEnd.next({ data: {}, url: 'my-path2' })\n    lastUrl.subscribe(val => console.log(`ObserverC ${val}`))\n  }, [])\n\n  return (\n    <>\n      <div>\u8f93\u51fa:</div>\n      <div id=\"shareReplayOutput\" />\n    </>\n  )\n}\nexport default Index",ee="import React, { useEffect, useState } from 'react'\nimport { of, merge, timer, interval, Notification, from, forkJoin } from 'rxjs'\nimport {\n  mapTo,\n  map,\n  concatMap,\n  catchError,\n  tap,\n  delay,\n  delayWhen,\n  dematerialize,\n  timeout,\n} from 'rxjs/operators'\nimport 'rxjs/add/operator/observeOn'\nimport { setHtml } from '../../../../utils/htmlTool'\nimport 'rxjs/add/operator/observeOn'\n\nconst Index: React.FC = () => {\n  useEffect(() => {\n    const source = of(1, 2, 3, 4).pipe(\n      tap(val => setHtml('tapOutput', `before map: ${val}`)),\n      map(val => val + 10),\n      tap(val => setHtml('tapOutput', `after map: ${val}`)),\n    )\n    source.subscribe(val => setHtml('tapOutput', val))\n  }, [])\n\n  return (\n    <>\n      <div>\u8f93\u51fa:</div>\n      <div id=\"tapOutput\" />\n    </>\n  )\n}\nexport default Index",te="import React, { useEffect, useState } from 'react'\nimport { of, merge, timer, interval, Notification, from, forkJoin } from 'rxjs'\nimport {\n  mapTo,\n  map,\n  concatMap,\n  catchError,\n  tap,\n  delay,\n  delayWhen,\n  dematerialize,\n  timeout,\n} from 'rxjs/operators'\nimport 'rxjs/add/operator/observeOn'\nimport { setHtml } from '../../../../utils/htmlTool'\nimport 'rxjs/add/operator/observeOn'\n\nconst Index: React.FC = () => {\n  useEffect(() => {\n    const source = of(null)\n    const example = merge(\n      source.pipe(mapTo('Hello')),\n      source.pipe(mapTo('World'), delay(1000)),\n      source.pipe(mapTo('GoodBye'), delay(2000)),\n      source.pipe(mapTo('World'), delay(3000)),\n    )\n    const subscribe = example.subscribe(val => setHtml('delayOutput', val))\n  }, [])\n\n  return (\n    <>\n      <div>\u8f93\u51fa:</div>\n      <div id=\"delayOutput\" />\n    </>\n  )\n}\nexport default Index",ne="import React, { useEffect, useState } from 'react'\nimport { of, merge, timer, interval, Notification, from, forkJoin } from 'rxjs'\nimport {\n  mapTo,\n  map,\n  concatMap,\n  catchError,\n  tap,\n  delay,\n  delayWhen,\n  dematerialize,\n  timeout,\n} from 'rxjs/operators'\nimport 'rxjs/add/operator/observeOn'\nimport { setHtml } from '../../../../utils/htmlTool'\nimport 'rxjs/add/operator/observeOn'\n\nconst Index: React.FC = () => {\n  useEffect(() => {\n    const message = interval(1000)\n    const delayForFiveSeconds = () => timer(3000)\n    const delayWhenExample = message.pipe(delayWhen(delayForFiveSeconds))\n    delayWhenExample.subscribe(val => setHtml('delayWhenOutput', val))\n  }, [])\n\n  return (\n    <>\n      <div>\u8f93\u51fa:</div>\n      <div id=\"delayWhenOutput\" />\n    </>\n  )\n}\nexport default Index",re="import React, { useEffect, useState } from 'react'\nimport { of, merge, timer, interval, Notification, from, forkJoin } from 'rxjs'\nimport {\n  mapTo,\n  map,\n  concatMap,\n  catchError,\n  tap,\n  delay,\n  delayWhen,\n  dematerialize,\n  timeout,\n} from 'rxjs/operators'\nimport 'rxjs/add/operator/observeOn'\nimport { setHtml } from '../../../../utils/htmlTool'\nimport 'rxjs/add/operator/observeOn'\n\nconst Index: React.FC = () => {\n  useEffect(() => {\n    // \u4f8b1: \u8f6c\u6362\u6210\u57fa\u7840\u7684promise\n    const sample = val => of(val).pipe(delay(3000))\n    sample('first example')\n      .toPromise()\n      .then(result => {\n        setHtml('toPromiseOutput', `From Promise:${result}`)\n      })\n\n    // \u4f8b2: \u8f6c\u6362\u6210\u57fa\u7840\u7684promise\n    // const example2 = () => {\n    //   return Promise.all([\n    //     sample('Promise 1').toPromise(),\n    //     sample('Promise 2').toPromise(),\n    //   ]);\n    // };\n    // example2().then(val => {\n    //   setHtml('toPromiseOutput', `Promise.all Result:${val}`);\n    // });\n    // // \u53ef\u4ee5\u76f4\u63a5\u4f7f\u7528forkJoin\uff0c\u800c\u4e0d\u662f\u4f7f\u7528toPromise\n    // const example3 = forkJoin(\n    //   sample('Observable 1'),\n    //   sample('Observable 2'),\n    // ).subscribe(val => setHtml('toPromiseOutput', val));\n  }, [])\n\n  return (\n    <>\n      <div>\u8f93\u51fa:</div>\n      <div id=\"toPromiseOutput\" />\n    </>\n  )\n}\nexport default Index",ae="import React, { useEffect, useState } from 'react'\nimport { of, merge, timer, interval, Notification, from, forkJoin } from 'rxjs'\nimport {\n  mapTo,\n  map,\n  concatMap,\n  catchError,\n  tap,\n  delay,\n  delayWhen,\n  dematerialize,\n  timeout,\n} from 'rxjs/operators'\nimport 'rxjs/add/operator/observeOn'\nimport { setHtml } from '../../../../utils/htmlTool'\n\nconst Index: React.FC = () => {\n  useEffect(() => {\n    // \u6a21\u62df\u8bf7\u6c42\n    const makeRequest = (timeToDelay: number) => {\n      return of('Request Complete!').pipe(delay(timeToDelay))\n    }\n    of(4000, 3000, 2000)\n      .pipe(\n        concatMap(duration =>\n          makeRequest(duration).pipe(\n            timeout(2500),\n            catchError(error => of(`Request timed out after: ${duration}`)),\n          ),\n        ),\n      )\n      .subscribe(val => setHtml('timeoutOutput', val))\n  }, [])\n\n  return (\n    <>\n      <div>\u8f93\u51fa:</div>\n      <div id=\"timeoutOutput\" />\n    </>\n  )\n}\nexport default Index",oe="import React, { useEffect } from 'react'\nimport {\n  Observable,\n  Observer,\n  async,\n  of,\n  asap,\n  range,\n  combineLatest,\n} from 'rxjs'\nimport { setHtml } from '../../../utils/htmlTool'\nimport { combineLatest as exampleCombineLatest } from 'rxjs/operators'\n\nconst Index: React.FC = () => {\n  useEffect(() => {\n    const a$ = of(1, 2)\n    // const a$ = of(1, 2, asap);\n    const b$ = of(10)\n    //const b$ = of(10, asap);\n    const c$ = combineLatest(a$, b$, (a, b) => a + b)\n    c$.subscribe(value => setHtml('index', value))\n\n    // \u5b9e\u4f8b\u64cd\u4f5c\u7b26\u7528\u6cd5\n    // const a$ = of(1, 2);\n    // const b$ = of(10).pipe(exampleCombineLatest(a$, (a, b) => a + b));\n    // b$.subscribe(value => setHtml('index', value));\n\n    // async \u8c03\u5ea6\u5668\n    // const observable = Observable.create(function subscribe(\n    //   observer: Observer<number>,\n    // ) {\n    //   observer.next(1);\n    //   observer.next(2);\n    //   observer.next(3);\n    //   observer.complete();\n    // }).observeOn(async);\n    // setHtml('index', 'before');\n    // observable.subscribe(\n    //   (value: number) => setHtml('index', value),\n    //   (err: Error) => setHtml('index', err),\n    //   () => setHtml('index', 'complete'),\n    // );\n    // setHtml('index', 'after');\n\n    //\u9759\u6001\u521b\u5efa\u64cd\u4f5c\u7b26\u901a\u5e38\u53ef\u4ee5\u63a5\u53d7\u8c03\u5ea6\u5668\u4f5c\u4e3a\u53c2\u6570;\n    // const observable = range(1, 10, async);\n    // setHtml('index', 'before');\n    // observable.subscribe(value => setHtml('index', value));\n    // setHtml('index', 'after');\n    // const observable = timer(2000, 10000);\n  }, [])\n\n  return (\n    <>\n      <div>\u8f93\u51fa:</div>\n      <div id=\"index\" />\n    </>\n  )\n}\nexport default Index",ie="import React, { useEffect } from 'react'\nimport { setHtml } from '../../../utils/htmlTool'\nimport { Subject } from 'rxjs'\n\nconst Index: React.FC = () => {\n  useEffect(() => {\n    const subject = new Subject()\n    subject.subscribe({\n      next: value => setHtml('subjectOutput', `observerA ${value}`),\n    })\n    subject.subscribe({\n      next: value => setHtml('subjectOutput', `observerB ${value}`),\n    })\n    subject.next(1)\n    subject.next(2)\n    // \u4f5c\u4e3aObservable\u7684subscribe\u65b9\u6cd5\u7684\u53c2\u6570\n    // const observable = from([1, 2, 3])\n    // observable.subscribe(subject)\n  }, [])\n\n  return (\n    <>\n      <div>\u8f93\u51fa:</div>\n      <div id=\"subjectOutput\" />\n    </>\n  )\n}\nexport default Index",ce="import React, { useEffect } from 'react'\nimport { BehaviorSubject } from 'rxjs'\nimport { throttleTime, scan } from 'rxjs/operators'\nimport { setHtml } from '../../../utils/htmlTool'\n\nconst Index: React.FC = () => {\n  useEffect(() => {\n    const subject = new BehaviorSubject(0)\n    subject.subscribe({\n      next: value => setHtml('BehaviorSubjectOutput', `observerA ${value}`),\n    })\n    subject.next(1)\n    subject.next(2)\n    subject.subscribe({\n      next: value => setHtml('BehaviorSubjectOutput', `observerB ${value}`),\n    })\n    subject.next(3)\n    // \u4e0d\u63d0\u4f9b\u4e0a\u9762 subject.next()\u4f1a\u600e\u4e48\u6837\uff1f\n  }, [])\n\n  return (\n    <>\n      <div>\u8f93\u51fa:</div>\n      <div id=\"BehaviorSubjectOutput\" />\n    </>\n  )\n}\nexport default Index",le="import React, { useEffect } from 'react'\nimport { ReplaySubject } from 'rxjs'\nimport { setHtml } from '../../../utils/htmlTool'\n\nconst Index: React.FC = () => {\n  useEffect(() => {\n    const subject = new ReplaySubject(3)\n    subject.subscribe({\n      next: value => setHtml('ReplaySubjectOutput', `observerA ${value}`),\n    })\n    subject.next(1)\n    subject.next(2)\n    subject.next(3)\n    subject.subscribe({\n      next: value => setHtml('ReplaySubjectOutput', `observerB ${value}`),\n    })\n    subject.next(4)\n    // \u6307\u5b9awindow time\u6765\u786e\u5b9a\u591a\u4e45\u4e4b\u524d\u7684\u503c\u53ef\u4ee5\u7f13\u5b58\n    // const subject = new ReplaySubject(10, 4000)\n    // subject.subscribe({ next: (value) =>setHtml('index', `observerA ${value}`) })\n    // let i = 0\n    // setInterval(() => {subject.next(i +=1)}, 1000)\n    // setTimeout(() => {\n    //   subject.subscribe({\n    //     next: (value) => setHtml('ReplaySubjectOutput', `observerB ${value}`)\n    //   });\n    //  },5000)\n  }, [])\n\n  return (\n    <>\n      <div>\u8f93\u51fa:</div>\n      <div id=\"ReplaySubjectOutput\" />\n    </>\n  )\n}\nexport default Index",ue="import React, { useEffect } from 'react'\nimport { AsyncSubject } from 'rxjs'\nimport { setHtml } from '../../../utils/htmlTool'\nimport { Button } from 'antd'\n\nconst Index: React.FC = () => {\n  useEffect(() => {\n    const subject = new AsyncSubject()\n    subject.subscribe(value =>\n      setHtml('AsyncSubjectOutput', `observerA ${value}`),\n    )\n    subject.next(1)\n    subject.next(2)\n    subject.subscribe(value =>\n      setHtml('AsyncSubj